import React from "react";
import { useNavigate, useLocation } from "react-router-dom";

function Review() {
  const navigate = useNavigate();
  const location = useLocation();
  const {
    startDate,
    endDate,
    week1Hours,
    week2Hours,
    travelHours,
    client,
    state,
  } = location.state || {};

  const handleGoBack = () => {
    navigate("/", {
      state: {
        startDate,
        endDate,
        week1Hours,
        week2Hours,
        travelHours,
        client,
        state,
      },
    });
  };

  return (
    <div className="min-h-screen bg-gray-100 p-4">
      <h1
        className="text-2xl font-bold mb-4 text-center"
        style={{ fontFamily: "Montserrat, sans-serif" }}
      >
        Review Timesheet
      </h1>
      <div className="max-w-md mx-auto bg-white p-6 rounded-lg shadow">
        <div className="space-y-6">
          <div>
            <h2 className="text-lg font-medium mb-2">Pay Period</h2>
            <p className="text-sm">
              <span className="font-medium">From:</span>{" "}
              {startDate || "Not set"}
            </p>
            <p className="text-sm">
              <span className="font-medium">To:</span> {endDate || "Not set"}
            </p>
          </div>
          <div>
            <h2 className="text-lg font-medium mb-2">Hours Worked</h2>
            <p className="text-sm">
              <span className="font-medium">Week 1:</span> {week1Hours || "0"}{" "}
              hours
            </p>
            <p className="text-sm">
              <span className="font-medium">Week 2:</span> {week2Hours || "0"}{" "}
              hours
            </p>
            <p className="text-sm">
              <span className="font-medium">Travel Hours:</span>{" "}
              {travelHours || "0"} hours
            </p>
          </div>
          <div>
            <h2 className="text-lg font-medium mb-2">Details</h2>
            <p className="text-sm">
              <span className="font-medium">Client:</span>{" "}
              {client || "Not selected"}
            </p>
            <p className="text-sm">
              <span className="font-medium">State:</span>{" "}
              {state || "Not selected"}
            </p>
          </div>
          <div className="flex space-x-4">
            <button
              onClick={handleGoBack}
              className="w-1/2 bg-gray-500 text-white p-2 rounded-2xl hover:bg-gray-600 transition-colors"
            >
              Go Back
            </button>
            <button className="w-1/2 bg-blue-600 text-white p-2 rounded-2xl hover:bg-blue-700 transition-colors">
              Submit
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Review;
